// val testData=loaddata("cust2017q3data","blackdata")
val trainingData=loaddata("cust2017q4data","ym2data")
val testData=loaddata("cust2017q3data","ym2data")
val data=trainingData.unionAll(testData)
//registip,registcity,registfrom
val indexer = new StringIndexer()
  .setInputCol("registfrom")
  .setOutputCol("registfromIndex")
  .fit(data)
// val indexed = indexer.transform(data)

val encoder = new OneHotEncoder()
  .setInputCol("registfromIndex")
  .setOutputCol("registfromVec").setDropLast(false)
// val encoded = encoder.transform(indexed)

// val indexer1 = new StringIndexer()
