val inputCols = data.columns.filter(_ != "label").filter(_ != "registfrom").filter(_ != "registip").filter(_ != "registcity")
        .filter(_ != "id").filter(_ != "customerId").filter(_ != "ctime")
val assembler = new VectorAssembler().setInputCols(inputCols).setOutputCol("features")
// val data=assembler.transform(encoded)//.drop(Array("registfromIndex").withColumn("features")

// Load and parse the data file, converting it to a DataFrame.
// val data = sqlContext.read.format("libsvm").load("data/mllib/sample_libsvm_data.txt")

// Index labels, adding metadata to the label column.
// Fit on whole dataset to include all labels in index.
val labelIndexer = new StringIndexer()
  .setInputCol("label")
  .setOutputCol("indexedLabel")
  .fit(data)
// Automatically identify categorical features, and index them.
// Set maxCategories so features with > 4 distinct values are treated as continuous.
val featureIndexer = new VectorIndexer()
  .setInputCol(assembler.getOutputCol)
  .setOutputCol("indexedFeatures")
  .setMaxCategories(10)
  .fit(assembler.transform(data))


// Train a RandomForest model.
val rf = new RandomForestClassifier()
  .setLabelCol("indexedLabel")
  .setFeaturesCol("indexedFeatures")
  .setNumTrees(10)
  .setImpurity("gini")//entropy
  .setMaxDepth(20)
//   .setMaxBins(100)

// Convert indexed labels back to original labels.
val labelConverter = new IndexToString()
  .setInputCol("prediction")
  .setOutputCol("predictedLabel")
  .setLabels(labelIndexer.labels)

// Chain indexers and forest in a Pipeline
val pipeline = new Pipeline()
  .setStages(Array(indexer,encoder,assembler,labelIndexer, featureIndexer, rf, labelConverter))
//====================训练======================
import org.apache.spark.ml.tuning.{ParamGridBuilder, TrainValidationSplit,TrainValidationSplitModel}
import scala.util.Random
//ParamGridBuilder构建一组参数
//TrainValidationSplit将尝试从这些所有值的组合中使用evaluator选出最好的模型
val paramGrid = new ParamGridBuilder()
//   .addGrid(rf.maxBins, Array(32, 60))
  .addGrid(rf.maxDepth, Array(10, 20))
  .addGrid(rf.impurity, Array("entropy", "gini"))
  .addGrid(rf.minInfoGain, Seq(0.0, 0.05,1.0))
  .addGrid(rf.numTrees, Seq(20,10))
  .addGrid(rf.minInstancesPerNode, Array(10, 20))
  .addGrid(rf.featureSubsetStrategy, Array("auto", "sqrt","log2"))
.addGrid(rf.subsamplingRate, Array(0.8, 1))
//   .addGrid(rf.maxMemoryInMB, Array(256, 512))
//   .addGrid(rf.checkpointInterval, Array(10, 20))
//   .addGrid(rf.cacheNodeIds, Array(false, true))
  .addGrid(rf.seed, Array(123456L, Random.nextLong()))
.build()
val evaluator=new BinaryClassificationEvaluator().setLabelCol("label")
//TrainValidationSplit 需要一个Estimator ， 一个Estimator ParamMaps集，一个Evaluator
val trainValidationSplit = new TrainValidationSplit()
  .setEstimator(pipeline)
  .setEvaluator(evaluator)
  .setEstimatorParamMaps(paramGrid)
  // 80% of the data will be used for training and the remaining 20% for validation.
  //80%数据作为训练，剩下的20%作为验证
  .setTrainRatio(0.8)

// Run train validation split, and choose the best set of parameters.
//运行训练校验分离，选择最好的参数。
val model = trainValidationSplit.fit(trainingData)

// Make predictions on test data. model is the model with combination of parameters
// that performed best.
//在测试数据上做预测，模型是参数组合中执行最好的一个
val predictions = model.transform(testData)
predictions.select("id","predictedLabel","prediction", "label", "indexedLabel","features").where("predictedLabel=1.0").show(5)
////==================预测评估========================
val accuracy = evaluator.evaluate(predictions)
println("Test Error = " + (1.0 - accuracy))

import org.apache.spark.ml.{PipelineModel, Pipeline}
val bestModel = model.bestModel
